text:
@damilare_alves I can't o.
Pls,if you are suffering from depression and you want to talk to someone about it,pls know that i am here for you.
I lost a friend to "depression" and i really don't want that MF to keep winning.

@trailduster6bt I have severe depression and my meds aren't even near enough for how I feel daily

And I just feel like shit all day

I don't think I can just "lighten up"

@trailduster6bt I have severe depression and my meds aren't even near enough for how I feel daily

And I just feel like shit all day

I don't think I can just "lighten up"

@tonyposnanski I suffer from anxiety and depression. 
Meds have truly kept anxiety in check but depression has been bad recently. 
I need to get back to the gym as excercise is really helpful. Need to get motivated.

@mydigression I bought books on dialect and middle English to get my story right.

My depression is like walking on ice, slippery and treacherous. As I approach either solstice, it gets considerably worse. No idea why.

Rest of the time, the meds take the worst edge off but that's it.

@CasarezKk @KenidraRWoods_ Hi I am Jen! I suffer from clinical depression and anxiety. I take daily meds for both. To add to this I tend to be a people pleaser.
In my head I think it's better/easier to make others happy than myself.
But I'm still fighting!

@Littlestsheep Medication for depression can take time to work up to full effect.
it's mostly time release stuff and sucks because you want to feel better right now not a week into the future.

I know how it feels, my own meds took around 2 or so weeks for me to even notice it starting to work.

@myillumind My depression is biological.  I've changed meds because of side effects but I  will never be off them.

There are times I can feel the depression trying to take over and I know I would not be coping without them. 

My depression destroys my creativity not my meds.

@pjf No, I'd stopped taking them by then. Then the things about which I'd been numb for so long, I started feeling.

I should clarify: I'd been prescribed them for OCD, not depression as such. Don't know if that makes a difference.

Definitely talk to a doc about maybe adjusting meds.

@ladywyyn @cmullin76 @commaficionado Currently taking Wellbutrin. It is for depression but is unoffically helpful for ADHD. It helped my focus and constant draining thoughts.

I hope to get stimulants eventually to be able to focus on long term projects.

The meds also help with weight loss and smoking.

@mastrap84 @ChrisPalmerMD @realcarriebrown struggled with similar symptoms as you, suicidality resistant depression. Relief with ketogenic diet.

There are many anecdotes, some published in research. 
I know how this sounds, but I also know how miserable living with a mood disorder is. 5/x
